%[text] %[text:anchor:T_52F94844] # **Edgeworth-Bowley Chart Examples**
%[text] **Overview**
%[text] The `EdgeworthBowleyChart` provides a means to represent various distributions of resources. It is a conceptual device for analysing possible trading relationships between two individuals or countries, using indifference curves. It is constructed by taking the indifference map of one individual (B) for two goods (X and Y) and inverting it to face the indifference map of a second individual (A) for the same two goods.
%[text] ![EdgeworthBowleyChart.png](text:image:3a67)
%[text] **Documentation**
%[text] - [`fitnlm`](<matlab: doc( "fitnlm" )>): fit a nonlinear regression model \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_C8644CDD] ## Load some sample chart data.
%[text] The chart input data should comprise two matrices, one for individual A and one for individual B. The first column of each matrix should be an equally-spaced, increasing vector with a maximum value of `Quantity1`, the first quantity under consideration.
%[text] The subsequent matrix columns are the indifference curves, storing the corresponding quantity of the second resource for the given quantity of the first quantity in the first column. If data is unavailable for the specific point, then it should be represented using a [`NaN`](<matlab: doc("NaN")>) (not a number). 
%[text] It is recommended to create the chart data by starting with matrices of `NaN`s, and then assign the available indifference curve values.
%[text] For example, a sample matrix $A$ for the Edgeworth-Bowley chart could be as follows.
%[text] $A = \\left\[\\begin{array}{cccccc}0.1 & 9.5 & \\vdots & \\dots & \\vdots & \\text{NaN}\\\\0.2 & 4.5 & \\vdots & \\dots & \\vdots & \\text{NaN}\\\\0.3 & 3 & \\vdots & \\dots & \\vdots & 9.7\\\\\\vdots & \\vdots & \\vdots & \\dots & \\vdots & \\vdots\\\\0.9 & 2.55 & \\vdots & \\dots & \\vdots & 4.55\\\\1.0 & 2.5 & \\vdots & \\dots & \\vdots & 4.5\\end{array}\\right\]$
%[text] 
load( fullfile( chartsRoot(), "data", "IndifferenceCurves.mat" ), "A", "B" )
disp("Chart A-data:") %[output:5e8e9f99]
disp(A) %[output:09fccddd]
disp("Chart B-data:") %[output:5d9f6afa]
disp(B) %[output:2b6f5d27]
%%
%[text] %[text:anchor:H_3CCE6F9E] ## Create a figure for the chart.
f = exampleFigure( "Name", "EdgeworthBowleyChart Example" ); %[output:26470813]
%%
%[text] %[text:anchor:H_C455257B] ## Create the chart, specifying the parent and input data.
EBC = EdgeworthBowleyChart( "Parent", f, ...    %[output:group:69c21b29] %[output:26470813]
    "AData", A, ... %[output:26470813]
    "BData", B ); %[output:group:69c21b29] %[output:26470813]
%%
%[text] %[text:anchor:H_28095A6C] ## Redefine the maximum resource values.
%[text] First, increase the quantity of resource 1.
EBC.Quantity1 = 12; %[output:3466149d]
%%
%[text] %[text:anchor:H_109A6D17] ## Decrease the quantity of resource 1.
EBC.Quantity1 = 7; %[output:998b592c]
%%
%[text] %[text:anchor:H_EA468454] ## Increase the quantity of resource 2.
EBC.Quantity2 = 13; %[output:0a2a0cb9]
%%
%[text] %[text:anchor:H_C21C1C57] ## Decrease the quantity of resource 2.
EBC.Quantity2 = 8; %[output:6275a521]
%%
